import Layout from "../components/Layout";

class Retrive extends React.Component {
  constructor() {
    super();
    this.state = {
      songs: []
    };
  }

  async componentWillMount() {
    await fetch("/api/admins", {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    });
  }

  render() {
    return (
      <Layout>
        <div>{this.state.songs}</div>
      </Layout>
    );
  }
}

export default Retrive;
